class Solution {
public:
    int getWinner(vector<int>& arr, int k) {
        int siz = arr.size();
        queue<int> que;
        for(auto it:arr)
            que.push(it);
        queue<int> tmp;
        int wins = 0;
        int cur = que.front();que.pop();
        while(wins < k && wins < siz-1){
            if(cur >que.front()){
                wins++;
                tmp.push(que.front());que.pop();
            }
            else{
                while(!tmp.empty()){
                    int n=tmp.front();tmp.pop();
                    que.push(n);
                    wins--;
                }
                que.push(cur);
                cur = que.front();que.pop();
                wins=1;
            }
        }
        return cur;
    }
};

